import Link from 'next/link';

const linkStyle = {
  marginRight: 15,
  width: 100,
  background: rgb(236, 236, 236) 
};

const Header = () => (
  <div>
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/contact">
      <a style={linkStyle}>Contact</a>
    </Link>
  </div>
);

export default Header;
